import React from 'react';

const SentContent = ({ emails }) => (
  <div className="content-container">
    {emails.map((email, index) => (
      <div key={index}>
        <p>Do: {email.recipient}</p>
        <p>Temat: {email.subject}</p>
        <p>Treść: {email.content}</p>
      </div>
    ))}
  </div>
);

export default SentContent;
